import React from 'react'
import { BrowserRouter, Route } from 'react-router-dom'

const PageOne = () => {
    return <div>Page One</div>
}

const PageTwo = () => {
    return <div>
        <button>Click me</button>
    </div>
}


const App = () => {
    return (
        <div>
            <div>
            <BrowserRouter>
            <Route path="/" exact component={PageOne} />
            <Route path="/pagetwo"  component={PageTwo} />
            </BrowserRouter>
            </div>
        </div>
    )
}

export default App;
